import axios from "axios";
import React from "react";
import { useQuery } from "react-query";

type EntriesListProps = {}

const API_BASE_URL = 'http://localhost:3001';

// Create an instance of Axios with the base URL configured
const api = axios.create({
  baseURL: API_BASE_URL,
});

const fetchItems = async () => {
  const {data} = await api.get(`/entry/all`);
  return data;
};

const EntiresList: React.FC<EntriesListProps> = (props:EntriesListProps) => {
  const { data, error, isLoading } = useQuery('items', getAllEntries);

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.toString()}</div>;

  let processedData = (data) ? Object.values(data) : [];
  console.log(processedData);

  return (
    <div>
      <h1>Items</h1>
      <ul>
        {processedData.map((item: any) => (
          <li key={item.id}>{item.message}</li>
        ))}
      </ul>
    </div>
  );
}

export default EntiresList;
